import React from 'react';

class FormData extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      // isChecked:this.props.isChecked,
    };
  }

 
  render(){
    return (
			<div>
				<div>first name</div>
				<div>last name</div>
				<div>age name</div>
				<div>free text</div>
				<button>Back</button>
				<button>Send Survey</button>
			</div>	
			);

  }
}

export default FormData;
